package abi_test

import (
	"encoding/hex"
	"testing"

	"github.com/MetalBlockchain/antelopevm/chain"
	"github.com/MetalBlockchain/antelopevm/chain/abi"
	"github.com/MetalBlockchain/antelopevm/crypto/rlp"
	"github.com/stretchr/testify/assert"
)

func TestEosioSystemDecode(t *testing.T) {
	//data, err := os.ReadFile("eosio.system/eosio.system.abi")
	//assert.NoError(t, err)
	data, err := hex.DecodeString("")
	setAbi := &chain.SetAbi{}
	rlp.DecodeBytes(data, setAbi)
	_, err = abi.NewABI(setAbi.Abi)
	assert.NoError(t, err)
}
